using System;
using System.Collections.Generic;
using NUnit.Framework;

namespace Exercises;

[TestFixture]
public class LongestSubstringWithoutRepeatingCharacters
{
    private record Range(int From, int To);

    public int LengthOfLongestSubstring(string s)
    {
        Dictionary<char, int> set = [];

        var range = new Range(0, 0);
        int max = 0;
        for (var i = 0; i < s.Length; i++)
        {
            var currentChar = s[i];
            if (set.TryAdd(currentChar, i))
            {
                range = range with { To = i };
                max = Math.Max(max, range.To - range.From + 1);
            }
            else
            {
                var memo = set[currentChar];
                range = range with { From = memo + 1};
                set[currentChar] = i;
                CleanSet(set, range);
            }
        }

        return max;
    }

    private static void CleanSet(Dictionary<char, int> set, Range range)
    {
        foreach (var keyValuePair in set)
        {
            if (keyValuePair.Value < range.From)
            {
                set.Remove(keyValuePair.Key);
            }
        }
    }


    [Test]
    public void Case1()
    {
        // Act
        var res = LengthOfLongestSubstring("abcabcbb");

        // Assert
        Assert.That(res, Is.EqualTo(3));
    }

    [Test]
    public void Case2()
    {
        // Act
        var res = LengthOfLongestSubstring("abcd");

        // Assert
        Assert.That(res, Is.EqualTo(4));
    }

    [Test]
    public void Case3()
    {
        // Act
        var res = LengthOfLongestSubstring("pwwkew");

        // Assert
        Assert.That(res, Is.EqualTo(3));
    }

    [Test]
    public void Case4()
    {
        // Act
        var res = LengthOfLongestSubstring("aab");

        // Assert
        Assert.That(res, Is.EqualTo(2));
    }

    [Test]
    public void Case5()
    {
        // Act
        var res = LengthOfLongestSubstring("dvdf");

        // Assert
        Assert.That(res, Is.EqualTo(3));
    }

